package main

import (
    "fmt"
    "math"
)

func RoundedAvg(n, m int) interface{} {
    if n > m {
        return -1
    }

    sum := 0
    count := m - n + 1

    for i := n; i <= m; i++ {
        sum += i
    }

    avg := float64(sum) / float64(count)
    roundedAvg := int(math.Round(avg))

    return fmt.Sprintf("0b%s", fmt.Sprintf("%b", roundedAvg))
}
